  false,\n\t\"url\": null,\n\t\"notes\": \"This data represents the extent of the
  nation's coastal zone, as defined by the individual states and territories under
  the Coastal Zone Management Act of 1972 (CZMA). The CZMA was established to preserve,
  protect, develop, and where possible, to restore or enhance the resources of the
  nation's coastal zone. The zone generally extends seaward to the boundary of the
  Submerged Lands Act. The zone extends inland from the shorelines only to the extent
  necessary to control shorelands that have a direct and significant impact on coastal
  waters. Lands held in trust by the Federal Government have been included in this
  boundary unless otherwise noted, as accurately representing these could be erroneous.
  This boundary is unofficial. For precise, regulatory boundaries please contact the
  state or territorial coastal program office.\",\n\t\"license_title\": null,\n\t\"extras\":
